import BooksIcon from "./BooksIcon";
import "./WelcomeContainer.css";
import { useEffect, setWorkouts, useState } from "react";
const Courses = (props) => {
  const [Workouts, setWorkouts]= useState(null)

  useEffect(()=> {
    const fetchWorouts = async () => {
      const response = await fetch('/api/courses')
      const json = await response.json()

      if (response.ok){
        setWorkouts(json)
      }
    }
    fetchWorouts() 
  }, [])

const WelcomeContainer = () => {
  return (
    <div className="welcome">
      <div className="welcome-sara">
        <b>{`Welcome, `}</b>
        {Workouts && Workouts.map((workouts) =>(
        
        
        <i className="sara"> <p>key={workouts.id}{workouts.title}</p></i>
          
        ))}
        <i className="sara"> <p>{workouts.title}</p></i>
      </div>
      <img className="welcome-child" alt="" src="/vector-726.svg" />
      <BooksIcon
        booksIconBooks="/books1.svg"
        booksIconPosition="absolute"
        booksIconWidth="17.76%"
        booksIconHeight="100%"
        booksIconTop="0%"
        booksIconRight="3.86%"
        booksIconBottom="0%"
        booksIconLeft="78.38%"
        booksIconMaxWidth="100%"
        booksIconOverflow="hidden"
        booksIconMaxHeight="100%"
      />
    </div>
  );
};
};
export default WelcomeContainer;
